import React from 'react'

class Nav extends React.Component {
  render() {
    return (
    <div>  
    <div className="App">
      <h1>Test</h1>
    </div>
    <div className="nav">
      <h1>Logo goes here</h1>
      <img src="/Logo/Logo-brainflix.png" />
    </div>
    </div>
    )
  }
}

export default Nav;
